(3, 'journal', NULL, 'National Security Bangladesh 2002', 'kanan mahmud', NULL, NULL, NULL, 'local', '70fca694a9b71e358694206c10ee3e27.jpg', '1531899027.pdf', '["c-1-1531899027"]', NULL, NULL, NULL, 'Asian Publication', '1780', NULL, NULL, NULL, '["6"]', NULL, NULL, '500', 'USD', '554566514', NULL, 'GOVT', 'dddd', NULL, '10', '3', NULL, '2018-07-18', 19, NULL, '2018-07-19 09:17:31', '2018-07-18 01:30:27'),
(4, 'book', NULL, 'National Security Bangladesh 2010', 'kanan mahmud', NULL, NULL, NULL, 'local', '46a31f255d442ec874479b67401eacb5.jpg', '1531902175.pdf', '["c-1-1531902175","c-2-1531902175","c-3-1531902175"]', NULL, 'author', NULL, 'Asian Publication', '1780', NULL, NULL, NULL, '["2"]', '["kaan","maaa","sun","il","yeesds"]', '3', '500', 'USD', 'ISBN-2540', NULL, 'GOVT', 'fgdfg', NULL, '10', '3', 'map,tables,graph', '2018-07-18', 19, '1', '2018-07-19 07:39:01', '2018-07-19 01:39:01'),
(5, 'book', NULL, 'Indian Ocean as a Zone of Peace: The Concept and Alternatives', 'K.P. Misra', NULL, NULL, NULL, 'local', '467b537d7cd1628e50c75a56fec6c0f3.jpg', '1532235522.pdf', '["c-1-1532235522","c-2-1532235522","c-3-1532235522","c-4-1532235522","c-5-1532235522"]', NULL, 'author', '5th', 'Asian Publication', '1780', 'illus', NULL, NULL, '["2"]', '["travel","international","govt","bangladesh"]', '5', '500', 'USD', 'ISBN-2540', NULL, 'GOVT', 'ddd', NULL, '10', '3', 'map,tables,graph', '2018-07-22', 19, '1', '2018-07-26 07:47:50', '2018-07-26 01:47:50'),
(7, 'book', NULL, 'Nepali State, Society and Human Security: An Infinite Discourse', 'Dhruba Kumar', NULL, NULL, NULL, 'local', '74e003178f3a07ec3eca6e4ccc11199d.jpg', '1532341120.pdf', '["c-1-1532341120","c-2-1532341120","c-3-1532341120"]', NULL, 'author', '1st', 'BIISS publication', '2008', 'this is illus', '3', 'yes', '["6"]', '["dafdsf"]', '3', '200', 'USD', 'ISBN53655', NULL, 'GOVT', 'Export diversification helps a country to increase export earnings and create\r\nemployment opportunities, especially in labour-intensive export sectors.\r\nProduct and geographical diversifications are believed to be associated with\r\nreduced volatility in export earnings and vulnerability to sharp declines in\r\nterms of trade in developing countries. Bangladesh has witnessed remarkable\r\nexport growth over the last two decades. However, despite policy indicatives\r\nfor diversification, exports are overly dependent on readymade garments\r\nand concentrated to European Union and North American markets. Given this\r\nbackdrop, the present paper tries to derive empirical evidence on whether\r\nthe level of export diversification has positive linkage with export growth\r\nin Bangladesh. In doing so, it adopts time series econometric techniques to\r\nestimate an export supply function. The empirical results reveal that even\r\nthough export diversification has positive but statistically insignificant\r\nlinkage with quantity of export supplied in the world market, Bangladesh\r\nshould pursue the ongoing policy measures to realise statistically significant\r\nbenefits of export diversification in the long run.', NULL, '10', '3', 'Bibliography', '2018-07-23', 19, NULL, '2018-07-29 06:10:32', '2018-07-29 00:10:32'),
(8, 'book', NULL, 'Bangladesh: Society, Polity, Economy', 'Iftekharuzzaman', NULL, NULL, NULL, 'local', 'e4f6945a510162c35758023b2035124f.jpg', '1532341568.pdf', '["c-1-1532341568","c-2-1532341568","c-3-1532341568"]', NULL, 'editor', '1st', 'BIISS publication', '2011', 'asdas', '3', 'yes', '["5"]', '["sdfds"]', '3', '200', 'USD', 'ISBN53655', NULL, 'GOVT', 'Bangladesh has been experiencing spectacular growth in exports for over\r\na decade, which has emerged as a fundamental pillar of positive external sector\r\nperformance, macroeconomic stability, manufacturing growth and creating\r\nemployment for significant portion of less skilled and semi-skilled labour force of\r\nthe country. The growth has been led predominantly by Readymade Garments\r\n(RMG), which is primarily concentrated on few major geographical destinations like\r\nEuropean Union (EU), the USA and Canada. However, it is widely argued that overly\r\nreliance on one or few items in export basket and high geographical concentration\r\ncan be detrimental for export earning if the products are exposed to declining\r\ndemand and the destination countries experience macroeconomic instability or\r\nfinancial crisis. In other words, diversified bundle of export is a protection towards\r\nunpredictable price fluctuations and sudden shocks in specific product market', NULL, '10', '3', 'srfgsdf', '2018-07-16', 19, NULL, '2018-07-29 06:17:23', '2018-07-29 00:17:23'),
(9, 'book', NULL, 'The Security of Small States', 'M. Abdul Hafiz', NULL, NULL, NULL, 'local', 'f671d4ff1d87617fcfbc0699d89724f6.png', '1532341719.pdf', '["c-1-1532341719","c-2-1532341719","c-3-1532341719"]', NULL, 'editor', '1st', 'dsfsdf', '1987', 'this is illus', '3', 'yes', '["6"]', '["sdfsdfsdf"]', '3', '100', 'USD', 'ISBN5465', NULL, 'GGG', 'Bangladesh has been witnessing transition from “traditional” (raw jute, tea, etc.) to\r\n“non-traditional” (frozen food, leather item, pharmaceuticals, textiles, etc.) items and primary\r\nto manufactured products. The improvement in diversification of export of Bangladesh\r\nresults from the expansion of new export markets or destination. However, Razzaque and\r\nRaihan8\r\n reveals that the export base still remains narrow and undiversified even though\r\nthere are some new items in the export basket of the country. The argument is subsequently', NULL, '5', '30', 'asd', '2018-07-16', 19, NULL, '2018-07-29 06:18:41', '2018-07-29 00:18:41'),
(10, 'book', NULL, 'Nation Building in Bangladesh: Retrospect and Prospect', 'Abdur Rob Khan', NULL, NULL, NULL, 'local', 'cbd1535205268a2bcda02920c5ba6dc5.jpg', '1532341784.pdf', '["c-1-1532341784","c-2-1532341784"]', NULL, 'author', '5th', 'BIISS publication', '1987', 'this is illus', '3', 'yes', '["2"]', '["sgfsd"]', '2', '200', 'USD', 'ISBN53655', NULL, 'GOVT', 'Bangladesh’s position in the international division of labour and global value\r\nchain and the demand and prospects in the world market are the main drivers so far\r\nto determine the export policy of the country. Again, rapid generation of employment\r\nopportunities as envisioned in the upcoming Seventh Five-Year Plan (2016-2020)\r\ncan be prompted through increased export earnings and labour-intensive jobs.\r\nThe government has given special emphasis on export growth which has become\r\ndouble digit over the past two decades. Nevertheless, a sudden shock can be avoided\r\nthrough creation of a diversified export basket and destinations, which rationalises\r\nundertaking a pragmatic and effective strategy for export diversification.', NULL, '10', '3', 'Bibliography', '2018-07-17', 19, NULL, '2018-07-29 06:19:56', '2018-07-29 00:19:56'),
(11, 'book', NULL, 'Civil Society and Democracy in Bangladesh', 'Mizan R Khan', NULL, NULL, NULL, 'local', '2f2ef498569e383244133d8a3a8c5b5b.jpg', '1532342366.pdf', '["c-1-1532342366","c-2-1532342366","c-3-1532342366"]', NULL, 'author', '1st', 'BIISS publication', '2008', 'this is illus', '3', 'yes', '["5"]', '["dfdsf"]', '3', '300', 'USD', 'ISBN53655', NULL, 'GOVT', 'Export diversification helps a country to increase export earnings and create\r\nemployment opportunities, especially in labour-intensive export sectors.\r\nProduct and geographical diversifications are believed to be associated with\r\nreduced volatility in export earnings and vulnerability to sharp declines in\r\nterms of trade in developing countries. Bangladesh has witnessed remarkable\r\nexport growth over the last two decades. However, despite policy indicatives\r\nfor diversification, exports are overly dependent on readymade garments\r\nand concentrated to European Union and North American markets. Given this\r\nbackdrop, the present paper tries to derive empirical evidence on whether\r\nthe level of export diversification has positive linkage with export growth\r\nin Bangladesh. In doing so, it adopts time series econometric techniques to\r\nestimate an export supply function. The empirical results reveal that even\r\nthough export diversification has positive but statistically insignificant\r\nlinkage with quantity of export supplied in the world market, Bangladesh\r\nshould pursue the ongoing policy measures to realise statistically significant\r\nbenefits of export diversification in the long run.', NULL, '10', '3', 'Bibliography', '2018-07-23', 19, NULL, '2018-07-29 06:16:06', '2018-07-29 00:16:06'),
