(18, 'seminar', NULL, 'The US-Bangladesh Relations: Working Together on Global Issues', NULL, 'Bangladesh Institute of International and Strategic Studies', 'BIISS', 'Major General A K M Abdur Rahman', NULL, '2f277482f70609c2d9650b95daa8f77d.png', '1532517027.pdf', '["c-1-1532517027","c-2-1532517027","c-3-1532517027","c-4-1532517027","c-5-1532517027","c-6-1532517027"]', NULL, NULL, NULL, 'biiss publication', '2017', NULL, NULL, NULL, '["2"]', NULL, '6', NULL, NULL, NULL, NULL, NULL, 'this is abs', NULL, '10', '3', 'this is bibligraphy', NULL, 19, '1', '2018-07-26 06:56:08', '2018-07-26 00:56:08'),
(19, 'seminar', NULL, 'The US-Bangladesh Relations: Working Together on Global Issues 2019', NULL, 'Bangladesh Institute of International and Strategic Studies', 'BIISS', 'Major General A K M Abdur Rahman', NULL, '95feffc4d4434e13df0f3ce61e5d880a.png', '1532517479.pdf', '["c-1-1532517479","c-2-1532517479","c-3-1532517479","c-4-1532517479","c-5-1532517479","c-6-1532517479","c-7-1532517479","c-8-1532517479"]', NULL, NULL, NULL, 'biiss publication', '2017', NULL, NULL, NULL, '["6"]', NULL, '8', NULL, NULL, NULL, NULL, NULL, 'this is abstraction', NULL, '10', '3', 'this is bibligraphy', NULL, 19, '2', '2018-07-29 04:52:44', '2018-07-28 22:52:44'),
(20, 'seminar', NULL, 'Contemporary Thoughts on Enhancing Bangladesh-Myanmar Relations', NULL, 'Bangladesh Institute of International and Strategic Studies (BIISS)', 'Bangladesh Institute of International and Strategic Studies (BIISS)', 'Dr. M Jashim Uddin', NULL, '958ecd36c1150206c2cf0d61cff20d4f.png', '1532840829.pdf', '["c-1-1532840829","c-2-1532840829","c-3-1532840829"]', '1532840829', NULL, NULL, 'Bangladesh Institute of International and Strategic Studies (BIISS)', '2015', NULL, NULL, NULL, '["4"]', '["contemporary","thoughts","relations"]', '3', NULL, NULL, NULL, NULL, NULL, 'It can be undoubtedly said that stronger business ties between the two countries now have\r\nbecome a new demand from both sides as there are great potentials in utilizing natural\r\nresources in both the countries through mutual investment and exchange of expertise.\r\nEven though trade volumes between Bangladesh and Myanmar are low, the potential is\r\nvery high. Along with huge potentials in the field of trade and commerce, there are also\r\nhuge possibilities of multimodal communications in rail road and sea between the two\r\ncountries. Though there are some challenges, both the countries should expand the\r\nhelping hand toward each other to mutually resolve those bilateral irritants peacefully.', NULL, '5', '30', 'asd', NULL, 19, '2', '2018-08-02 09:06:11', '2018-08-02 03:06:11'),
(21, 'seminar', NULL, 'Welcome to BIISS', NULL, 'Bangladesh Institute of International and Strategic Studies (BIISS)', 'BIISS', 'Major General A K M Abdur Rahman', NULL, '7df17ff5ebd8a60f10726dfdf4487348.jpg', '1533199040.pdf', '["c-1-1533199040","c-2-1533199040","c-3-1533199040"]', '1533199040', NULL, NULL, 'biiss publication', '2017', NULL, NULL, NULL, '["2"]', '["biiss"]', '3', NULL, NULL, NULL, NULL, NULL, 'Bangladesh Institute of International and Strategic Studies (BIISS) is a statutory institution established on 25 June, 1978 by the Government of the People’s Republic of Bangladesh. The Institute was established with aim of the undertaking and promoting research and deliberation on international affairs, security and developmental issues. The Institute is also expected to advance knowledge and understanding of contemporary international and strategic issues in national and regional perspectives.', NULL, '10', '3', 'this is bibligraphy', NULL, 19, '1', '2018-08-02 08:40:04', '2018-08-02 02:40:04');
